function getCookieURL(website_page) {
    var name = website_page + "=";
    var ca = document.cookie.split(';');
    for(var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
            return c.substring(name.length, c.length);
        }
    }
    return "";
}

function setCookieUrl(utm, utmvar, exdays) {
    var d = new Date();
    d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
    var expires = "expires="+ d.toUTCString();
    var val = (utmvar == null || utmvar == undefined) ? " " : utmvar;
    document.cookie = utm + "=" + val + ";" + expires + ";path=/";
}

function headerScroll(){

    var headerOffsetTop = $('.ordering__steps').offset().top;
    var headerHeight = $('.ordering__steps').offset().top;

    $j( window ).resize(function() {
        if($('.tariffs-block').css('display') == 'block'){
            headerOffsetTop = $('.ordering__steps').offset().top;
            headerHeight = $('.ordering__steps').height();
        }
    });
    $(window).scroll(function(){
        if($('.ordering__steps').parent().hasClass('header-lock') == false) {
            if(headerOffsetTop==0 || headerHeight == 0){
                headerOffsetTop = $('.ordering__steps').offset().top;
                headerHeight = $('.ordering__steps').height();
            }

            var sticky = $('.ordering__steps'),
                scroll = $(window).scrollTop();

            if (scroll >= headerOffsetTop) {
                    sticky.addClass('fixed-steps');
                    $(".form-block").css('margin-top', 100);
            }
            else {
                    sticky.removeClass('fixed-steps');
                    $(".form-block").css('margin-top', "")
            }
        }
    });
}

function getQueryParams(qs) {
    qs = qs.split('+').join(' ');
    var params = {},
        tokens,
        re = /[?&]?([^=]+)=([^&]*)/g;
    while (tokens = re.exec(qs)) {
        params[decodeURIComponent(tokens[1])] = decodeURIComponent(tokens[2]);
    }
    return params;
}

