function getCookieParam(cookieVar) {
    let cookieArr = document.cookie.split(';');
    for (let cookieElement of cookieArr) {
        let nameValuePair = cookieElement.trim().split('=');
        if (nameValuePair[0] == cookieVar) {
            return nameValuePair[1];   
        }
    }
    return null;
}

function setClientIdToCookies() {
    let gaGlobalValue = getCookieParam('_ga');
    let clientId = gaGlobalValue.substring(6);
    let cookieString = 'apex__clientId=' + clientId;
    document.cookie = cookieString;  
}

function isPhoneNumberLkValid(element, regex){
    let isValid = false;
    let elementLength = element.val().length;
    if((elementLength == 16) && regex.test(element.val())){
        element.closest(".block__inputs").removeClass("error");
        element.closest(".block__inputs").addClass("goods");
        isValid = true;
    } else {
        element.closest(".block__inputs").removeClass("goods");
        element.closest(".block__inputs").addClass("error");
        isValid = false;
    }
    return isValid;
}